import "./App.css";
import {
  Switch,
  Route,
  Redirect,
  withRouter,
  RedirectWithStatus,
} from "react-router-dom";
import ConvertUrl from "./components/ConvertUrl";
import ShortUrl from "./components/ShortUrl";
import GenericNotFound from "./components/GenericNotFound";

function App() {
  return (
    <div className="App">
      <Switch>
        <Route exact path="/" component={ConvertUrl} />
        <Route path="/:code" component={ShortUrl} />
        <Route path="/nopage/404" component={GenericNotFound} />
        <RedirectWithStatus
          status={302}
          from="/redirect/302"
          to="/nopage/404"
        />
      </Switch>
    </div>
  );
}

export default withRouter(App);
